this.scene.addListener('hitEvent', (hitSprite) => {
    if (hitSprite.x == this.x && hitSprite.y == this.y && (this.scene.game.player.equipped.weapon.projectile == 'fireball' || this.scene.game.player.equipped.weapon.projectile == 'fireslash')) {
        hitSprite.destroy();
        this.scene.sounds.enemyHit.play();
        this.setFrame(1);
            let count = 0; this.displayItems = this.scene.add.container();
            let timeEvent = this.scene.time.addEvent({ delay: 1000, loop: true, callback: () => {

                this.displayItems.removeAll();

                if (count < 5) {
                    for (let i = 0; i < 10; i++) {
                        this.displayItems.add(this.scene.add.sprite(this.scene.player.x + ((Math.random() - 0.5) * 200), this.scene.player.y + ((Math.random() - 0.5) * 200), 'face'));
                    }

                    count++;
                } else {
                    this.displayItems.removeAll();
                    timeEvent.destroy();
                }

            }});
   }
});
